import React from 'react';
import { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { postUploadItemIdx, getUserId, postMintTokn } from '../api';
import { EstCreateItem, getAmountAll, mintNFT } from '../utilityUnits/connMintService';

export const MintItemCpnt = ({title, desc, toknUri, rightInfo}) => {
  const SEND_ADDR = sessionStorage.getItem('chainid');
  const navigate = useNavigate();
  const [NumOfTokn, setNumOfTokn] = useState();
  const [price, setValue] = useState();
  const [PRIVATE_KEY, setPrivKey] = useState(null);
  const [modalFlag, setFlag] = useState(false);
  const [estGasFee, setGasFee] = useState();
  const [Royalty, setLowest] = useState(0);
  const [active, setActive] = useState(false);

  useEffect(() => {
    exclusiveParsing();
  },[toknUri, rightInfo])

  const exclusiveParsing = () => {
    let result = rightInfo.split('/');
    //console.log(result[1]);
    if(result[1] === 'Exclusive'){
      setActive(true);
      setNumOfTokn(1);
    }
    else
      setActive(false);
  }
  const setNFT = async() => {
    const royality = (Royalty*100000+'0000000000000');
    const tokenUri = rightInfo+toknUri;
    //const currentId = await getAmountAll();
    if(title !== '' && desc !== '')
      uploadItemIdx();    
    else
      alert('Please enter the title and description of the item to be uploaded');

    // mintNFT(SEND_ADDR, tokenUri, NumOfTokn, royality, PRIVATE_KEY).then(
    //   result => {
    //     if(result === true){
    //       //putDBtoknIDX(currentId);
    //       alert('üéâSuccessfully minted');
    //     }
    //     else
    //       alert(`‚ö†Ô∏èErr: ${result}`);
    //   }
    // )
  }
  const uploadItemIdx = async() => {
    const userId = await getUserId(SEND_ADDR);
    const record = {
      title: title,
      desc: desc,
      hash: toknUri,
      userId: userId
    }
    postUploadItemIdx(record).then(response => {
      console.log(response);
    })
  }
  const putDBtoknIDX = async(currentId) => {
    const userId = await getUserId(SEND_ADDR);
    const record = {
      hash: toknUri,
      toknId: currentId,
      userId: userId,
      mintNum: NumOfTokn
    }
    console.log(record);
    postMintTokn(record).then(result => {
      if(result) navigate("/myinfo");
      else console.log(result);
    })
  }
  const inputDataConfirm = async() => {
    const royality = (Royalty*100000+'0000000000000');
    const tokenUri = rightInfo+toknUri;
    console.log(royality, tokenUri, SEND_ADDR, price, NumOfTokn);
    setFlag(true);
  }
  return(
    <>
    {/* <button onClick={putDBtoknIDX}>temp</button> */}
    <h4>mintItem.js</h4>
    <h5>quantity: <input placeholder='number of token' onChange={(evt)=>setNumOfTokn(evt.target.value)} disabled={active}/></h5>
    <h5>price: <input placeholder='number of token' onChange={(evt)=>setValue(evt.target.value)} /></h5>
    <h5>royalties: <input placeholder='MATIC' onChange={(evt)=>setLowest(evt.target.value)}/></h5>
    <h5>private Key: <input placeholder='input your private key to mint nft' onChange={(evt)=>setPrivKey(evt.target.value)} size='45'/></h5>
    <button onClick={inputDataConfirm}>NFTmint</button>
    <AlertModal 
      showFlag={modalFlag}
      NofTokn={NumOfTokn}
      price= {price}
      estGasFee={estGasFee}
      setFlag={setFlag}
      startSale={setNFT}
    />
    </>
  )
}

const AlertModal = ({showFlag, setFlag, NofTokn, price, estGasFee, startSale}) => {
  return(
    <>{showFlag ? ( // showFlag„Ååtrue„Å†„Å£„Åü„ÇâModal„ÇíË°®Á§∫„Åô„Çã
      <div id="overlay" className='overlay'>
        <div id="modalcontents" className="modalcontents">
        <p>
          ÌåêÎß§ ÌôïÏù∏.<br/>
          ÌåêÎß§ÏàòÎüâ: {NofTokn}<br/>
          ÌåêÎß§Í∞ÄÍ≤©: {price}<br/>
          ÏòàÏÉÅÎêòÎäî ÏàòÏàòÎ£å: {estGasFee}e-8 MATIC<br/>
        </p>
        <button onClick={()=>setFlag(false)}>cancel</button>
        <button onClick={startSale}>confirm</button>
        </div>
      </div>
      ) : (
        <></>// showFlag„Ååfalse„ÅÆÂ†¥Âêà„ÅØModal„ÅØË°®Á§∫„Åó„Å™„ÅÑ)
      )}
    </>
  )
}
